package org.singleton.summary.algorithm.eclat;

public class TidResult {
	private String key;
	private int value;
	public TidResult(String key, int value) {
		// TODO Auto-generated constructor stub
		this.key =key;
		this.value = value;
	}
	public String getKey() {
		return key;
	}
	public void setKey(String key) {
		this.key = key;
	}
	public int getValue() {
		return value;
	}
	public void setValue(int value) {
		this.value = value;
	}
}
